import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { TestFormService } from '../../../services/test-form.service';
import { MatTableDataSource } from '@angular/material';
import { UserDataService } from '../../services/user-data.service';
import { User } from 'src/app/models/user.model';
import { DatePipe } from '@angular/common';
import * as jsPDF from 'jspdf';
import * as html2canvas from 'html2canvas';
import * as domtoimg from 'dom-to-image';
import {element} from "protractor";

export interface TestForm {
  observationName: string ;
  observationValue: string;
  unit: string;
  referenceRange: string;
}

@Component({
  selector: 'app-view-test',
  templateUrl: './view-test.component.html',
  styleUrls: ['./view-test.component.css'],
  providers: [DatePipe]
})



export class ViewTestComponent implements OnInit {

  private testId;
  private testName;
  private date: Date;
  private user = new User();
  private testResults;
  private userAge;
  private displayedColums: string[] = ['tests', 'value', 'unit', 'referenceRange'];
  private testValueData = [];
  private datasource;

  constructor(private route: ActivatedRoute, private testFormServise: TestFormService, private userDataService: UserDataService,private datepipe:DatePipe) { }

  ngOnInit() {
    this.userDataService.currentData.subscribe(user => this.user = user);
    this.datasource = new MatTableDataSource();
    this.oninitfunction();


  }


  async oninitfunction() {
    await this.createTestResults();

  }


  createTestResults() {
    this.route.queryParams.subscribe(params => {
      this.testId = params.id;
      console.log(params.id);
    });
    this.testFormServise.getTestResults(this.testId).subscribe((data: any) => {
      this.testResults = data;
      console.log(this.testResults);
      this.testName = data.testName;
      this.date = new Date(data.date);
      console.log('this is date ' + this.date);
      console.log('this is data  ' + data.testName);
      data.observations.forEach(element => {
        let tunit;
        let trrange;
        if (element.observationId.unit === undefined) {
          tunit = 'NA';
          trrange = 'NA';
        } else {
          tunit = element.observationId.unit;
          trrange = element.observationId.referenceRange;
        }
        const jobj = {test: element.observationId.observationName, observation: element.observationValue, unit: tunit, referenceRange: trrange};
        this.testValueData.push(jobj);

      });
      console.log(this.testValueData);

      console.log("birth day "+this.user.birthDay);
      console.log("birth day "+new Date(this.user.birthDay).getTime());
      var timeDiff = Math.abs(Date.now() - new Date(this.user.birthDay).getTime());
      console.log("age "+Math.floor(timeDiff / (1000 * 3600 * 24) / 365.25));
      this.userAge=Math.floor(timeDiff / (1000 * 3600 * 24) / 365.25);
      this.datasource.data = this.testValueData;
    });
  }

  download() {
    console.log('download');
    const doc = new jsPDF('p', 'mm', 'a4');
    const imgdata = 'data:image/jpeg;base64,';

    doc.addImage(imgdata, 'JPEG', 0, 0, 210, 297);

    doc.setFontSize(10);
    doc.text(27,25.6,this.user.firstName);
    doc.text(29,29.8,this.user.sex);
    doc.text(27, 34.1,String(this.userAge));
    doc.text(27, 38.3,this.datepipe.transform(this.date));


    const testX=15;
    var testY=73;
    this.testResults.observations.forEach(element=>{
      const observationName=element.observationId.observationName;
      const unit=element.observationId.unit;
      const referenceRange=element.observationId.referenceRange;
      const observationValue=element.observationValue;
      doc.text(15, testY,observationName);
      doc.text(74.3, testY,observationValue);
      doc.text(127.8,testY,unit);
      doc.text(158.5, testY,referenceRange);
      testY=testY+6;
    });
    doc.save('testreport.pdf');


  }



}
